import styled from "styled-components";

export const Container = styled.div`
    margin: 20px auto 0;
    padding: 0 20px;
    max-width: 700px;
    
    article {
        background-color: #9032;
        border: 1px solid #000;
        border-radius: 5px;
        padding: 20px;
        margin-bottom: 20px;

        p {
            font-size: 16px;
            
        }

    }
`

